import styled from "@emotion/styled";
import { Button } from "@mui/material";

export const StyledIconButton = styled(Button)(({ theme, variant }) => ({
  color:
    variant === "contained"
      ? theme.palette.primary.main
      : theme.palette.secondary.main,
  borderRadius: 6,
}));
